column8:
カテゴリー：バスケットボール<BR>
種別：バスケットボールシューズ<BR>
商品名：LADY GEL FLASH 5（レディーゲルフラッシュ5）<BR>
品番：TBF401<BR>
カラー：<BR>
0104（ホワイト×イエロー）<BR>
0133（ホワイト×パープル）<BR>
9019（ブラック×ピンク）<BR><BR>

仕様・素材<BR>
インナーソール:取り替え式<BR>
生産国：ベトナム・中国<BR>
アッパー素材：<BR>
本体＝人工皮革製+合成繊維製<BR>
補強＝人工皮革製<BR>
アウター素材：ゴム底<BR>
付属品:シューレース（0104・0133にはホワイトのシューレース、<BR>
9019にはブラックのシューレースが付属）<BR><BR>

＜商品説明＞<BR>
L.A.コンフォート機能を強化。中足部の樹脂パーツによりフットワークの安定性を高め、<BR>
母趾球部や土踏まず部への負担を軽減。<BR>
ヒールアップ構造とアウターソールのピボットサークルが<BR>
スムーズなターンを促し、膝への負担を軽減。<BR>
足首まわリに大型スポンジ、アッパー素材にやわらかい人工皮革を<BR>
使用したやわらかく足あたりの優しい履き心地。<style type="text/css">
